/* Car sales data is simulated numbers and not actual sales numbers. For real sales numbers go to  https://mobilitysweden.se/statistik/databas-nyregistreringar */
/* Brand data from wikipedia and official yearly reports */

CREATE TABLE IF NOT EXISTS Carsales(
	country varchar(64),
	brandid varchar(64),
	model varchar(64),
	period timestamp,
	class varchar(16),
	groupid varchar(64),
	sales integer
);

CREATE TABLE IF NOT EXISTS brand(
    brandid       VARCHAR(64),
    founded         TIMESTAMP,
    country         VARCHAR(64),
    city            VARCHAR(64),
    geolocation     TEXT,
    logo            TEXT,
    groupid         VARCHAR(64),
    models          TEXT,
    comment         TEXT,
    totalsales      INTEGER
);

CREATE TABLE IF NOT EXISTS Corporation(
    groupid           VARCHAR(64),
    logo              TEXT,
    members           TEXT
);

